class node {
protected:
  int min_; // m
  int max_; // M
public:
  node(int min, int max): min_(min), max_(max) {
  }
  node() {
    node(0, 0);
  }
  int get_min() {return min_;}
  int get_max() {return max_;}
  static bool compare_min(node x, node y) {
    return x.get_min() < y.get_min();
  }
  static bool compare_max(node x, node y) {
    return x.get_max() < y.get_max();
  }
  bool includes(int x) {
    return (min_ <= x && x <= max_);
  }
};

class leaf : public node {
  int offset_; // e
public:
  leaf(int offset, int min, int max): node(min, max), offset_(offset) {
  }
  leaf() {
    leaf(0, 0, 0);
  }
  int get_offset() {return offset_;}
};


class suc_tree {
  int fwd_lookup(uint bits, int d);
  uint fwd_search_inblock(uint i, int d);
  int tree_search(int node, int d);
public:
  suc_tree(const cs::bitVector& bv);
  void print_nodes();
  uint inspect(uint i);
  bool isleaf(uint i);
  uint fwd_search(uint i, int d);
  uint fwd_search_naive(uint i, int d);
  uint find_close(uint i);
  bool is_ancestor(uint i, uint j);
  int block_sum(uint i, uint j);
  const bitVector& bv_;
  uint size_; // n
  int num_blocks_; // n / s
  int tree_depth_; // P
  int num_nodes_;
  int start_node_offset_;
  vector<node> nodes_;
  vector<leaf> leaves_;
};

